trans-unit.source:
Example: <code>
              DatagramSocket s = new DatagramSocket(null);
              s.bind(new InetSocketAddress(8888));
 </code> Which is equivalent to: <code>
              DatagramSocket s = new DatagramSocket(8888);
 </code> Both cases will create a DatagramSocket able to receive broadcasts on UDP port 8888.

